import { FaGithub } from "react-icons/fa";
import { FaLinkedin } from "react-icons/fa";
export default function Landing() {
  return (
    <div className="wrapper">
      <div className="container">
        <div className="box box1">
          <h1>
            I'M <br />
            WELID <br />
            LABIDI.
          </h1>
          <h2>Web Developer</h2>
          <button className="btn-enter">
            <a href="/index">ENTER</a>
          </button>
          <br />
          <a href="https://github.com/welidlabidi">
            <FaGithub />
          </a>
          <a href="https://www.linkedin.com/in/welid-labidi-086041187/">
            <FaLinkedin />
          </a>
        </div>
      </div>
      <style jsx>{`
        a {
          color: rgb(162, 177, 194);
          text-decoration: none;
        }
        body,
        html {
          height: 100%;
          margin: 0;
          background-image: url(/image/sea.jpg);
          background-position: center;
          background-repeat: no-repeat;
          background-size: cover;
        }
        #container {
          display: flex;
          flex-direction: row;
        }
        .box {
          position: absolute;
          display: block;
          border: gainsboro solid 3px;
          text-align: center;
          color: rgb(162, 177, 194);
          align-items: center;
        }
        .box1 {
          width: 300px;
          height: 200px;
          background-color: transparent;
          top: 200px;
          left: 500px;
        }
        .btn-enter {
          margin-top: 15%;
          width: 300px;
          height: 30px;
          background: transparent;
          color: rgb(162, 177, 194);
          margin-bottom: 10%;
        }
        .btn-enter:hover {
          transform: scale(1.1);
          box-shadow: 0 0 50px #d1cecc;
        }
      `}</style>
    </div>
  );
}
